/** @jsxRuntime classic */
/** @jsx jsx */
import { useState } from "react";
import { jsx, Styled } from "theme-ui";

export default function Buttons(props) {
  return (
    <Styled.a>
      <Styled.div
        sx={{
          cursor: "pointer",
          m: 0,
          px: [6],
          py: [7, 8],
          backgroundColor: "red",
          width: "50px",
          height: "100px",
        }}
      >
        <Styled.h5>{props.data}</Styled.h5>
      </Styled.div>
    </Styled.a>
  );
}
